INSERT INTO `tblindsetupindicators` (`IndicatorID`, `IndCategoryID`, `IndicatorType`, `IndicatorDescription`, `Reference`, `Notes`, `Unit`) VALUES
(1, 'PVP', 'Impact', 'Percentage of Most At Risk Populations (MARPs) who are HIV infected', 'UNGASS Guidelines on the Construction of Core Indicators - Concentrated and Low Prevalence Epidemics Indicators: Number 9', NULL, '%'),
(2, 'PVP', 'Outcome', 'Percentage of MARPs who received HIV testing in the last 12 months and who know the results', 'UNGASS Guidelines on the Construction of Core Indicators - Concentrated and Low Prevalence Epidemics Indicators: Number 3', NULL, '%'),
(3, 'PVP', 'Outcome', 'Percentage of MARPs who both correctly identify ways of preventing the sexual transmission of HIV and who reject major misconceptions about HIV transmission', 'UNGASS Guidelines on the Construction of Core Indicators - Concentrated and Low Prevalence Epidemics Indicators: Number 5', NULL, '%'),
(4, 'PVP', 'Outcome', 'Percentage of female and male sex workers reporting the use of a condom with their most recent client', 'UNGASS Guidelines on the Construction of Core Indicators - Concentrated and Low Prevalence Epidemics Indicators: Number 6', NULL, '%'),
(5, 'PVP', 'Outcome', 'Percentage of men (from general population or male sex workers) reporting the use of a condom the last time they had anal sex with a male partner', 'UNGASS Guidelines on the Construction of Core Indicators - Concentrated and Low Prevalence Epidemics Indicators: Number 7', NULL, '%'),
(6, 'PVP', 'Outcome', 'Percentage of injecting drug users who have adopted behaviour that reduces transmission of HIV, i.e., who avoid using non sterile injecting equipment and use condoms, in the last month', 'UNGASS Guidelines on the Construction of Core Indicators - Concentrated and Low Prevalence Epidemics Indicators: Number 8', NULL, '%'),
(7, 'PVP', 'Output', 'Number of MARPs reached with HIV prevention programmes in the preceding 12 months', 'UNGASS Guidelines on the Construction of Core Indicators ? Concentrated and Low Prevalence Epidemics Indicators: Number 4', NULL, 'MARPS'),
(8, 'PVP', 'Output', 'Number of young people that have accessed reproductive and child health services in the preceding 12 months', 'UNAIDS M&E Guideline for programmes for young people (Programmatic Core Indicator 5)', NULL, 'young people'),
(9, 'PGP', 'Impact', 'Percentage of persons who are HIV infected, by age group (15 ? 24; 24 ? 49; older than 49) ', 'UNGASS Guidelines on the Construction of Core Indicators ? Generalized Epidemics Indicators: Number 15', NULL, '%'),
(10, 'PGP', 'Outcome', 'Percentage of persons who both correctly identify ways of preventing the sexual transmission of HIV and who reject misconceptions about HIV transmission, disaggregated by age group', 'UNGASS Guidelines on the Construction of Core Indicators ? Generalized Epidemics Indicators: Number 10', NULL, '%'),
(11, 'PGP', 'Outcome', 'Percentage of women and men who have had sex before the age of 15, disaggregated by age group', 'UNGASS Guidelines on the Construction of Core Indicators ? Generalized Epidemics Indicators: Number 11', NULL, '%'),
(12, 'PGP', 'Outcome', 'Percentage of men and women who have had sex with multiple partners in the last 12 months, disaggregated by age group', 'UNGASS Guidelines on the Construction of Core Indicators ? Generalized Epidemics Indicators: Number 12', NULL, '%'),
(13, 'PGP', 'Outcome', 'Percentage of people reporting the use of a condom during sexual intercourse with a non regular sex partner, disaggregated by age group', 'UNGASS Guidelines on the Construction of Core Indicators ? Generalized Epidemics Indicators: Number 13', NULL, '%'),
(14, 'PGP', 'Output', 'Percentage of schools with teachers trained in life skills based HIV education who taught it regularly in the preceding 12 months', 'UNGASS Guidelines on the Construction of Core Indicators ? Generalized Epidemics Indicators: Number 3', NULL, '%'),
(15, 'PGP', 'Output', 'Number of booklets and brochures about HIV and/or AIDS that have been distributed to END USERS in the preceding 12 months', NULL, NULL, 'booklets and brochures'),
(16, 'PGP', 'Output', 'Number of hours of air time that spots or special programmes on HIV aired on the radio and TV in the preceding 12 months', NULL, NULL, 'hours of air time'),
(17, 'PGP', 'Output', 'Number of schools with functional youth clubs that incorporate HIV programmes in the club activities in the preceding 12 months', NULL, NULL, 'schools'),
(18, 'PGP', 'Output', 'Number of active peer educators in Zanzibar in the preceding 12 months', NULL, NULL, 'active peer educators'),
(19, 'PGP', 'Output', 'Number of persons reached with HIV prevention programmes in the preceding 12 months', NULL, 'Operation definition for ?regularly? for purposes of this indicator refers to a teacher teaching life skills based HIV and AIDS education two times a week?', 'people'),
(20, 'PGP', 'Output', 'Percentage of large workplaces (public & private) that have prevention and care policies and programmes', 'UNGASS Guidelines on the Construction of Core Indicators - Generalized Epidemics Indicators: Number 4', 'The operational definition of ?large? for purposes of this framework will be any workplace which is employing 20 or more persons', '%'),
(21, 'PGP', 'Output', 'Number of persons in the tourism industry that have participated in HIV prevention education in the preceding 12 months', NULL, NULL, 'people'),
(22, 'PGP', 'Output', 'Number of male and female condoms that have been distributed to end users during the preceding 12 months', NULL, 'Operational definition for ?functional? refers to the frequency of meetings and for purposes of this indicator, a club should meet at least one in a month.', 'condoms'),
(23, 'CTC', 'Impact', 'Percentage of adults and children with HIV still alive and known to be on treatment 12 months after initiation of antiretroviral therapy', 'UNGASS Guidelines on the Construction of Core Indicators - Generalized Epidemics Indicators: Number 16', NULL, '%'),
(24, 'CTC', 'Impact', 'Percentage of HIV infected infants born to HIV infected mothers', 'UNGASS Guidelines on the Construction of Core Indicators - Generalized Epidemics Indicators: Number 17', NULL, '%'),
(25, 'CTC', 'Impact', 'Percent of children aged 14 years or younger that are accessing antiretroviral therapy (ART)', NULL, 'The operational definition of ?large? for purposes of this framework will be any workplace which is employing 20 or more persons', '%'),
(26, 'CTC', 'Outcome', 'Percentage of patients with STIs at health care facilities who are appropriately diagnosed, treated and counselled', 'UNGASS Guidelines on the Construction of Core Indicators - Generalized Epidemics Indicators: Number 4', 'Health care facilities in this framework refer to both Government and Private ', '%'),
(27, 'CTC', 'Outcome', 'Percentage of women and men with advanced HIV infection receiving ARV combination therapy in the preceding 12 months', 'UNGASS Guidelines on the Construction of Core Indicators - Generalized Epidemics Indicators: Number 7', NULL, '%'),
(28, 'CTC', 'Outcome', 'Number of Persons Living with and Affected by HIV and AIDS (PLHAs), attending HIV testing and counselling or HIV treatment and care settings, who were screened for TB symptoms, in the preceding 12 months ', 'World Health Organisation (WHO) M&E toolkit for HIV, TB, Malaria (TB TI-4)', NULL, 'people'),
(29, 'CTC', 'Outcome', 'Percentage of randomly selected retail outlets and service delivery points that have condoms in stock', 'WHO M&E toolkit for HIV, TB, Malaria (HIV PI-3)', NULL, '%'),
(30, 'CTC', 'Output', 'Percentage of health care facilities that have the capacity and conditions to provide basic HIV counselling and testing and to manage HIV and AIDS clinical services', 'UNAIDS M&E guidelines for care and support (Core Indicator CS6); WHO M&E Toolkit for HIV/AIDS, TB and Malaria (Indicator HIV-TI3)', 'Research in the indicator will include those funded by ZAC and those funded from other sources', '%'),
(31, 'CTC', 'Output', 'Number of people who have received an HIV test and who know their status in the preceding 12 months', NULL, NULL, 'people'),
(32, 'CTC', 'Output', 'Percentage of health care facilities offering the minimum package for preventing HIV in infants and young children who have specific written guidelines on how to make referrals to facilities offering long term care and support services', 'UNAIDS M&E guidelines for HIV prevention in infants and young children  (Core Indicator 3)', 'Health care facilities in this framework refer to both Government and Private ', '%'),
(33, 'CTC', 'Output', 'Percentage of HIV infected pregnant women receiving a complete course of antiretroviral prophylaxis to reduce mother to child transmission in the preceding 12 months', 'UNGASS Guidelines on the Construction of Core Indicators - Generalized Epidemics Indicators: Number 6', NULL, '%'),
(34, 'CTC', 'Output', 'Percentage of blood units transfused in the last 12 months that have been adequately screened for HIV antibodies in accordance to national or WHO guidelines', 'UNGASS Guidelines on the Construction of Core Indicators - Generalized Epidemics Indicators: Number 9; WHO M&E toolkit for HIV, TB, Malaria (HIV PI-13)', NULL, '%'),
(35, 'CTC', 'Output', 'Number of health care facilities with at least one person trained on STI case management', NULL, NULL, 'health facilities'),
(36, 'CTC', 'Output', 'Percentage of STI service delivery points that have recorded at least one stock out in the preceding six months', 'UNAIDS M&E guideline for ARVs (Core Indicator 3, adapted)', NULL, '%'),
(37, 'CTC', 'Output', 'Percentage of health care facilities that have the capacity and conditions to provide advanced level HIV and AIDS care and support services, including provision of ART', 'PEPFAR July 2005 Indicator Guidelines (Care and Support Indicator 3); WHO M&E Toolkit for HIV/AIDS, TB and Malaria (Indicator HIV-TI2)', NULL, '%'),
(38, 'CTC', 'Output', 'Number of CSOs providing home based care for vulnerable households in the preceding 12 months', NULL, NULL, 'CSOs'),
(39, 'CTC', 'Output', 'Number of home based care person-visits in the preceding 12 months', NULL, NULL, 'HBC person-visits'),
(40, 'IMM', 'Impact', 'Ratio of current school attendance among orphans to that among non orphans, aged 7 to 14 years (MDG)', 'UNGASS Guidelines on the Construction of Core Indicators - Generalized Epidemics Indicators: Number 14', NULL, NULL),
(41, 'IMM', 'Output', 'Number of MVC receiving food, material, financial and/or educational support in the preceding 12 months', NULL, NULL, 'MVCs'),
(42, 'IMM', 'Output', 'Number of households with vulnerable persons who received, free of user charges, basic external support in caring for vulnerable persons in the household in the preceding 12 months', 'WHO M&E Toolkit indicator HIV-CS1', NULL, 'households'),
(43, 'MCI', 'Outcome', 'Percentage of coordination meetings organized by the District AIDS Coordinating Committee (DACCOM) in accordance with the schedule outlined in this HIV M&E framework [a functional DACCOM is one that will hold 80% of the scheduled coordination meetings]', NULL, 'Interpretation: Percentage of DACCOMs who meet with stakeholders at least three times a year', '%'),
(44, 'MCI', 'Output', 'Number of persons (per type of organisation) that have been trained in the planning, management, and/or monitoring of HIV service delivery in the preceding 12 months', NULL, 'This indicator assumes all training topics in the ZHAPMoS form are included under this heading', 'people'),
(45, 'MCI', 'Output', 'Number of DACCOMs and CSOs that have implemented HIV work plans in the preceding 12 months', NULL, NULL, 'DACCOMs and CSOs'),
(46, 'MCI', 'Output', 'National Composite policy index score', 'UNGASS Guidelines on the Construction of Core Indicators - Concentrated and Low Prevalence Epidemics Indicators: Number 2', 'Both public and private sector health care facilities', NULL),
(47, 'FRR', 'Output', 'Amount of national funds disbursed by all sectors for HIV programmes in the preceding 12 months', 'UNGASS (expanded) Guidelines on the Construction of Core Indicators - Concentrated and Low Prevalence Epidemics Indicators: Number 1', NULL, 'Tsh'),
