INSERT INTO `tblindsetupobjectives` (`ObjectiveID`, `ObjectiveType`, `ObjectiveDescription`) VALUES
(1, 'Overall', 'To reduce HIV and Sexually Transmitted Infections (STI) infections amongst the vulnerable population in Zanzibar by 50% by 2009'),
(2, 'Specific', 'To increase knowledge about STI and HIV infection and transmission routes'),
(3, 'Specific', 'To provide youth friendly sexual reproductive health services '),
(4, 'Specific', 'To promote life skills in vulnerable groups'),
(5, 'Specific', 'To promote behaviour change amongst all vulnerable groups'),
(8, 'Specific', 'To promote safer sexual behaviour'),
(9, 'Specific', 'To reduce STI infection amongst children by protecting them from child abuse'),
(10, 'Specific', 'To increase HIV advocacy and communication efforts'),
(11, 'Specific', 'To develop capacity for HIV workplace programmes'),
(12, 'Specific', 'To mainstream HIV responses (especially cultural sensitive tourism) in the tourism sector'),
(13, 'Specific', 'To increase the availability of male and female condoms and vaginal microbicides'),
(14, 'Overall', 'To increase access to comprehensive services for HIV prevention, treatment, continuum of quality care and support to infected and affected people by the health sector'),
(15, 'Specific', 'To expand the coverage of comprehensive, user friendly, voluntary and confidential HIV counselling and testing'),
(16, 'Specific', 'To reduce the transmission of HIV from mother to child'),
(17, 'Specific', 'To minimize the risk of HIV transmission through blood, blood products or invasive procedures in health and non health care settings'),
(18, 'Specific', 'To increase access to appropriate information and quality care for the management of STIs'),
(19, 'Specific', 'To increase the access of PLHAs to quality medical services and treatment, including antiretroviral (ARV) therapy'),
(20, 'Overall', 'To increase access to comprehensive services to support those infected by HIV and/or affected by HIV or AIDS'),
(21, 'Specific', 'To increase the coverage of and access to comprehensive support for PLHAs'),
(22, 'Specific', 'To promote an effective and sustainable system of supporting and caring for vulnerable children'),
(23, 'Specific', 'To improve management and coordination of the national response to HIV'),
(24, 'Specific', 'To increase awareness, involvement and commitment of private and public sectors in mitigating HIV'),
(25, 'Specific', 'To increase the capacity of HIV implementers to implement a comprehensive HIV response'),
(26, 'Specific', 'To mobilize sufficient and necessary resources from internal and external sources for the effective implementation of the national HIV response'),
(27, 'Specific', 'To establish a national M&E system, including a national routine programme monitoring system'),
(28, 'Specific', 'To improve biological and behavioural surveillance for HIV'),
(29, 'Specific', 'To increase the capacity and quality of surveillance, monitoring and research in STI'),
(30, 'Specific', 'To improve HIV research');
